import React from "react";
import "./Korpica.css";

export default function Korpica({ cartItems }) {
  console.log(cartItems);
  return (
    <div className="korpicaa">
      <div className="glavniDiv">
        <div className="cartLabel">CART ITEMS</div>
        {cartItems.map((item) => {
          return (
            <div key={item.id} className="itemuKorpici">
              {item.naziv.length > 20
                ? item.naziv.slice(0, 20) + "..."
                : item.naziv}
              {item.kolicina}
            </div>
          );
        })}
      </div>
      <div className="checkoutDugme">CHECKOUT</div>
    </div>
  );
}
